def depth_first_searchgraph: dict, vertex: int, visited: set, rec_stk: set -> bool:
"""
Recur for all neighbours.
If any neighbour is visited and in rec_stk then graph is cyclic.
>>> graph = {0:[], 1:[0, 3], 2:[0, 4], 3:[5], 4:[5], 5:[]}
>>> vertex, visited, rec_stk = 0, set, set
>>> depth_first_searchgraph, vertex, visited, rec_stk
False
"""
visited.addvertex
rec_stk.addvertex
for node in graph[vertex]:
if node not in visited:
if depth_first_searchgraph, node, visited, rec_stk:
return True
elif node in rec_stk:
return True
rec_stk.removevertex
return False

